column16:
additional params:
            delete_unmounted - delete parts of type with no other parts mounted in it;
                scheme(s) - place part only on hulls with specific hulls;
mount(m...), !mount(m...) - demand/exclude types of mounts;
and/or - operation on list of conditions: tag (tag required), !tag (no tag), zero (tech variable is zero), !zero (tech variable is not zero);
